class Article extends Component {
  state = {
    isOpen: true
  }
  render() {
    const {article} = this.props;
    const body = <section>{article.text}</section>;
    return (
      <div>
        <h2>
          {article.title}
          <button onClick={handleClick}>close</button>
        </h2>
        {body}
        <h3>creation date: {(new Date(article.date).toDateString())}</h3>
      </div>
        )
    }
}

